class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        li=[]
        r=[]
        tmp='''abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\"#$%&'()*+,-./:;<=>?@[\\]^_`{|}~'''
        if tmp in s:
            s=s.replace(tmp,'')
            s=tmp+s
        s_len=len(s)
        if s_len:
            for i in range(0,s_len):
                r.append(s[i:s_len])   
            for li_r in r:
                for i in range(0,len(li_r)):
                    li.append(s[i:len(li_r)])
            r=[]
            li=list(dict.fromkeys(li))
            li=sorted(li,key=len)
            s2=list(dict.fromkeys(s))
            for li_s in li:
                ok=True
                for i in s2:
                    if len(li_s.split(i))-1 > 1 :
                        ok=False
                        break
                if ok==True:
                    r.append(li_s)
            return len(r[-1])
        else:
            return 0

